import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';

// Import your HTML content components
import About from './About';
import Contact from './Contact';
import Consultancy from './Consultancy';
import Newsletter from './Newsletter';
import Home from './Home'; // Make sure you have a Home component

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          {/* Remove the logo and "Edit src/App.js and save to reload" */}
          <h1>Your App Header</h1>
        </header>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/consultancy">Consultancy</Link>
            </li>
            <li>
              <Link to="/newsletter">Newsletter</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          {/* Define routes for your HTML content components */}
          <Route path="/about" element={<About />} />
          <Route path="/consultancy" element={<Consultancy />} />
          <Route path="/newsletter" element={<Newsletter />} />
          <Route path="/contact" element={<Contact />} />
          <Route index element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
